import React, { Component } from "react";
import { Container, Button, Row, Col } from "react-bootstrap";

class Primitiva extends Component {
  constructor(props) {
    super(props);
    // this._service = new EuroService();
    this.state = {};
  }

  render() {
    let arrButtons1 = [];
    for (let i = 1; i < 10; i++) {
      arrButtons1.push(
        <Button variant="dark" type="submit">
          {i}
        </Button>
      );
    }
    let arrButtons2 = [];
    for (let i = 10; i < 20; i++) {
      arrButtons2.push(
        <Button variant="dark" type="submit">
          {i}
        </Button>
      );
    }
    return (
      <Container>
        <section>
          <h1>Primitiva</h1>
        </section>
        <Row>
          <Col xs={1}>
            <p>1</p>
            {arrButtons1}
          </Col>
          <Col xs={1}>{arrButtons1}</Col>
        </Row>
      </Container>
    );
  }
}

export default Primitiva;
